import React from "react";
import { Routes, Route } from "react-router-dom";
import Main from "./Components/Main";
import Planner from "./Components/Planner";

function App() {

	return (
		<div className='App'>
			<Routes>
				<Route path='/' element={<Planner/>}/>
				<Route path='/planner' element={<Main/>}/>
			</Routes>
		</div>
	);
}

export default App;
